import Head from 'next/head';
import Navbar from '../components/Navbar';

const Layout = (props) => (
    <div>
        <Head>
            <title>BitxPrice</title>
            <link rel="stylesheet" href="../Bootstrap/bootstrap.min.css" />
        </Head>
        <Navbar />
        {props.children}
    </div>
);

export default Layout;
